import React from 'react';
import VideoBackground from '../layout/VideoBackground';
import AboutSection from '../layout/AboutSection';

const HomePage = () => {

    return (
        <>
            <div className='home-panel-one' >
                <VideoBackground />
            </div>
            <div className='home-panel-two' >
                <AboutSection />
            </div>
        </>
    )
};

export default HomePage;
